reviewBody:
의심이 많아서 치과를 10군데 가봤지만 여기만한곳은 없었던듯 일단 친절은 기본인데 다른곳들보면 4가지 없는 치과도 많음. 여기는 고객 응대가 상당히 체계적이고 좋음. 또 치료도 그냥 이거해야돼요가 아니라 하나하나 사진으로 문제되는 부위 보여주고 재료며, 가격이며 리스트마냥 쭉 뽑아줘서 선택의 폭이 넓어서 믿을만함 
개인적으로 10개중에 맘에든곳이라 추천함
강남대형치과에서는 충치치료 하지마시길;;

